import React, { useState } from "react";
import "../styles/Login.css";
import Logo from "../assets/logo light.jpg";

function Login() {
  const [showCard2, setShowCard2] = useState(false);
  const [role, setRole] = useState("patient");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const [loading, setLoading] = useState(false);

  const handleLoginClick = () => {
    setShowCard2(true);
  };

  const handleNextClick = async () => {
    setLoading(true);
    setErrorMessage("");

    let url = "";
    let body = {};

    if (role === "admin") {
      url = "http://localhost:8080/auth/admin/login";
      body = { adminId: username, password };
    } else if (role === "doctor") {
      url = "http://localhost:8080/auth/doctor/login";
      body = { email: username, password };
    } else {
      url = "http://localhost:8080/auth/patient/login";
      body = { phone: username, password };
    }

    try {
      const response = await fetch(url, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(body),
      });

      const data = await response.json();

      if (!response.ok) {
        if (response.status === 401) {
          setErrorMessage("Invalid credentials. Please check your input.");
        } else if (response.status >= 500) {
          setErrorMessage("Server error. Please try again later.");
        } else {
          setErrorMessage(data.message || "An unknown error occurred.");
        }
        return;
      }

      localStorage.setItem("token", data.token);
      localStorage.setItem("role", role);

      window.location.href = `/${role}/dashboard`;
    } catch (error) {
      setErrorMessage("Network error. Please check your connection.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="Login-Cards">
      <div
        className={`card-transition ${showCard2 ? "card-hide" : "card-show"}`}
      >
        <div className="Login-card-1">
          <img src={Logo} alt="" />
          <h2>Login to Medical Notes</h2>
          <p>Access patient data, prescriptions, and visit history securely.</p>
          <button className="btn btn-primary" onClick={handleLoginClick}>
            Login
          </button>
        </div>
      </div>

      <div
        className={`card-transition ${showCard2 ? "card-show" : "card-hide"}`}
      >
        <div className="login-container Login-card-2">
          <img src={Logo} alt="" className="logo" />
          <h2>Sign in to MedicNotes</h2>
          <p className="subtitle">Access your Account securely</p>

          <label htmlFor="role">I am a</label>
          <select
            id="role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
          >
            <option value="patient">Patient</option>
            <option value="doctor">Doctor</option>
            <option value="admin">Admin</option>
          </select>

          <label htmlFor="email">Username or Email or Id</label>
          <input
            type="text"
            id="email"
            placeholder="e.g., dr.john@example.com"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />

          <label htmlFor="password">Password</label>
          <input
            type="password"
            id="password"
            placeholder="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />

          {errorMessage && <p className="error-message">{errorMessage}</p>}
          {loading && <p className="loading-message">Logging in...</p>}

          <button className="btn" onClick={handleNextClick} disabled={loading}>
            Next
          </button>
        </div>
      </div>
    </div>
  );
}

export default Login;
